import React from 'react';
import ContextMenu from './ContextMenu';

export default class SettingsMenu extends React.Component {
    constructor(props) {
        super(props);

        this.state = {
            x: this.props.X,
            y: this.props.Y
        };
    }

    render() {
        return (<div id="settings-menu" className="context-menu">
            <div className="context-menu-item">
            <input type="file" defaultValue="Upload"/>
            </div>
            <div className="context-menu-item">
                {"Merge Spreadsheets"}
            </div>
        </div>);
    }
}
